import React from 'react';

import '../css/Contacts.css';
import { contacts } from '../EditMe';

function Contacts() {
    return (
        <div className="contacts-container">
            <div className="main">
                {contacts.description}
            </div>
        </div>
    );
}

export default Contacts;
